/*
 * Method definition
 */
def update_list(String element, List env_list)
{
    // Scripts not permitted to use method java.util.List set
    // Scripts not permitted to use DefaultGroovyMethods each | eachWithIndex
    env_list_clone = []

    def found = false
    def element_key = element.tokenize('=').getAt(0)
    def element_value = element.tokenize('=').getAt(1)

    for (env in env_list)
    {
        def env_key = env.tokenize('=').getAt(0)
        def env_value = env.tokenize('=').getAt(1)

        if (!found && element_key == env_key )
        {
            found = true
            if(element_value != env_value)
            {
                print "INFO: overwriting list element ${env_key}"
                echo "'${env_value}' --> '${element_value}'"
                env_value = element_value
                // Scripts not permitted to use method java.util.Map remove
                //  properties_map.remove(element_key)
            }
        }
        env_list_clone.add("${env_key}=${env_value}")
    } /* for */

    if (!found ){
        echo "Add new element ${element}"
        env_list_clone.add(element)
    } /* if not updated  */

    echo env_list_clone.toString()
    return env_list_clone
} /* update_list */

def get_workspace(String node_label)
{
    /*
     * Currently, the Snippet Generator reads: "The following variables are currently unavailable inside a Pipeline script: env.WORKSPACE".
     * This seems like an easy limitation to overcome, by setting the env.WORKSPACE variable when executing within a node{} or ws{} block.
     */
    if(isUnix()){ sh 'pwd > workspace' } else { bat 'echo %cd% > workspace' }
    workspace = readFile('workspace')
    workspace = workspace.trim() // Remove endline which causes joins to fail

    echo "Using workspace as: ${workspace}"
    return workspace
} /* get_workspace */

def save_environment(String workspace, String properties_file, String stash_name)
{
    // This helps in case the workspace is different for the job
    // e.g: concurrent executions
    sh("[ -e ./${properties_file} ] || cp -vf ${workspace}/${properties_file} .")
    stash includes: '*.properties', name: stash_name
} /* save_environment */

/*
 * Merges the env_list with the contents of the un-stashed properties file
 */
def update_environment(String stash_name, String properties_file, ArrayList env_list)
{
    /* is there a way to get the un-stashed files in a String/List? */
    unstash "${stash_name}"

    /* parse a pseudo properties_map from a file */
    def properties = readFile("${properties_file}").tokenize('\n')

    // Scripts not permitted to use method java.util.List set
    // Scripts not permitted to use DefaultGroovyMethods each | eachWithIndex
    env_list_clone = []

    /*
     * Update the values in the environment list with those present in the properties map
     */
    for (environment in env_list)
    {
        def environment_key = environment.tokenize('=').getAt(0)
        def environment_value = environment.tokenize('=').getAt(1)

        for (property in properties)
        {
            def property_key = property.tokenize('=').getAt(0)
            def property_value = property.tokenize('=').getAt(1)

            /* Check for null */
            property_value = property_value ? property_value : ' '

            if (environment_key == property_key && environment_value != property_value)
            {
                echo "INFO: overwriting property ${property_key}"
                echo "'${environment_value}' --> '${property_value}'"
                environment_value = property_value
                // Scripts not permitted to use method java.util.Map remove
                //  properties_map.remove(element_key)
            }
        } /* for properties_map */
        env_list_clone.add("${environment_key}=${environment_value}")
    } /* for env_list */

    /*
     * Now that all values in the environment_list were updated against the properties stored in the stash
     * we shall continue with the new values present on the properties list but not on the environment
     */
    for (property in properties)
    {
        def exists = false
        def property_key = property.tokenize('=').getAt(0)
        def property_value = property.tokenize('=').getAt(1)

        /* Check for null */
        property_value = property_value ? property_value : ' '

        for (environment in env_list)
        {
            def environment_key = environment.tokenize('=').getAt(0)

            /* mark tag as already present */
            if (property_key == environment_key)
            {
                /* TODO: add a break */
                exists = true
            }
        } /* for env_list */

        if (!exists)
        {
            echo "INFO: adding new environment value ${property_key}"
            env_list_clone.add("${property_key}=${property_value}")
        } /* if not updated  */
    } /* for properties_map */

    echo env_list_clone.toString()
    return env_list_clone
} /* update_environment  */
